export const uploadComponent = ({ onFileChange }) => {
    const handleFileChange = (event) => {
        const file = event.target.files[0];
        onFileChange(file);
    }
    return (
        <input type = "file" accept = ".txt, .java, .py" onChange = {handleFileChange} />
    );
  };
